import React, { useEffect, useState } from "react";
import "../styles/gallery.css";

const Gallery = () => {
  const [images, setImages] = useState([]);

  useEffect(() => {
    // Example images, replace with dynamic sources
    const sampleImages = [
      "/assets/image1.jpg",
      "/assets/image2.jpg",
      "/assets/image3.jpg",
      "/assets/image4.jpg",
      "/assets/image5.jpg",
      "/assets/image6.jpg",
    ];
    setImages(sampleImages);
  }, []);

  return (
    <div className="gallery-container">
      <div className="gallery">
        {images.map((src, index) => (
          <img key={index} src={src} alt={`Gallery ${index}`} className="gallery-item" />
        ))}
      </div>
    </div>
  );
};

export default Gallery;
